public static boolean isUpnFormatAclEntries(Map<String, String> aclEntries) {
  for (Map.Entry<String, String> entry : aclEntries.entrySet()) {
    if (entry.getKey().contains(AbfsHttpConstants.AT)) {
      return true;
    }
  }
  return false;
}
